import React, { Component } from "react";
import Imgbg from "../images/bgimage.png";

class Header extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <h2>Türkiye'nin İnternet Televizyonu</h2>
          <img src={Imgbg} className="headerimage" />
        </div>
      </div>
    );
  }
}
export default Header;
